__Closed_won_QTD_1.query:
q0 = load "${App.Datasets.FscDemoOpportunity.FullyQualifiedName}";
q = filter q0 by 'ISWON' == "true";
q = filter q by 'ISCLOSED' == "true";
q = filter q by date('CLOSEDATE_Year', 'CLOSEDATE_Month', 'CLOSEDATE_Day') in ["current quarter".."current day"];
q = group q0 by all left, q by all;
q = foreach q generate coalesce(sum(q.'AMOUNT'),0) as 'sum_AMOUNT';
q = limit q 2000;

_Quota_amount_1.query:
q0 = load "${App.Datasets.FscDemoQuota.FullyQualifiedName}";
q = filter q0 by date('STARTDATE_Year', 'STARTDATE_Month', 'STARTDATE_Day') in ["current quarter".."current day"];
q = group q0 by all left, q by all;
q = foreach q generate coalesce(sum(q.'QUOTAAMOUNT'),0) as 'sum_QUOTAAMOUNT';
q = limit q 2000;

_AUM_1.query:
x = load "${App.Datasets.FscDemoFinancialAccount.FullyQualifiedName}";
q = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
q = filter q by 'RECORDTYPENAME' != "Household";
q = group q by all;
q = foreach q generate sum('AUM') as 'sum_FinServ__Balance__c';
q = limit q 2000;

Leads_received_QTD_1.query:
q = load "${App.Datasets.FscDemoLead.FullyQualifiedName}";
q1 = filter q by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in ["current quarter".."current day"];
q = group q by all left, q1 by all;
q = foreach q generate count(q1) as 'count';
q = limit q 2000;

Leads_created_over_t_1.query:
leads = load "${App.Datasets.FscDemoLead.FullyQualifiedName}";
reference = load "${App.Datasets.FscDemoAccountSnapshot.FullyQualifiedName}";
reference = filter reference by date('SnapshotDate_Year', 'SnapshotDate_Month', 'SnapshotDate_Day') in ["2 quarters ago".."current day"];
result = group reference by ('SnapshotDate_Year', 'SnapshotDate_Week') left, leads by ('CREATEDDATE_Year', 'CREATEDDATE_Week');
result = foreach result generate reference.'SnapshotDate_Year' + "~~~" + reference.'SnapshotDate_Week' as 'CREATEDDATE_Year~~~CREATEDDATE_Week', count(leads) as 'count';
result = order result by 'CREATEDDATE_Year~~~CREATEDDATE_Week' asc;
result = limit result 2000;
